import React, { Component } from "react";

export default class TimeCount extends Component {
    constructor(props) {
        super(props);

        this.state = {
            totalTime: 0

        }
    }
    allTime = (list) => {
        list.map(piece =>
            this.setState({
                totalTime: this.state.totalTime + piece.TimeAdder.state.totalTime
            }

            ))

    }

    render() {
        return (
            <div>
                <h1>Total Time: {this.state.totalTime}</h1>
            </div>
        )

    }
}
